script: |
  super -f text -I q956.spq | sort > q956.out

inputs:
  - name: q956.spq
    data: |
      SELECT * FROM tab0 (FORMAT parquet) WHERE NOT - - col0 BETWEEN - 64 * - col2 * + CAST ( 35 AS INTEGER ) * + - 57 + 58 AND + 54;
  - name: tab0

outputs:
  - name: q956.out
    data: |
      87	21	10
      97	1	99
